"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?38/57/39831/abstract/1\">",
"      Haines DE, DiMarco JP. Current therapy for supraventricular tachycardia. Curr Probl Cardiol 1992; 17:411.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?38/57/39831/abstract/2\">",
"      Singh BN, Ellrodt G, Peter CT. Verapamil: a review of its pharmacological properties and therapeutic use. Drugs 1978; 15:169.",
"     </a>",
"    </li>",
