var title_f38_57_39839="Ultrasound biceps contraction and relaxation";
var content_f38_57_39839=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"videoplayer\" h264=\"./images/NEURO/76097/US_biceps_cont_relax_conv.mp4?title=Ultrasound+biceps+contraction+and+relaxation\" style=\"width:320px;height:256px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Ultrasound biceps contraction and relaxation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 215px; height: 372px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is an axial real-time image of the biceps (B) over the mid humerus (H); note a thin layer of subcutaneous tissue (S). The elbow is initially extended, and then gently flexed to 90 degrees; a slow full isometric contraction of the biceps follows, with repeated cycles of isometric relaxation and contraction. Note the shifting of fascicles as the muscle contracts and bulges, significantly increasing the diameter of the muscle belly.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Francis O Walker, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
